import React from "react";

import { styled } from "styled-components";
const OrderConfirmed = () => {
  const PageDiv = styled.div`
    background-color: #ce2829;
    color: white;
  `;
  const ContainerDiv = styled.div`
    width: 50%;
    margin: auto;
    text-align: center;
  `;
  const SummaryDiv = styled.div`
    border: 0.5rem solid white;
    width: 50%;
    display: flex;
    flex-direction: column;
    margin: auto;
  `;
  const Summary1 = styled.div`
    display: flex;
    justify-content: space-evenly;
  `;
  const Summary2 = styled.div`
    display: flex;
    justify-content: space-evenly;
  `;

  return (
    <PageDiv>
      <ContainerDiv className="container">
        <p>Lezzetin yolda</p>
        <p>SİPARİŞ ALINDI</p>
        <hr></hr>
        <h5>pizzaname</h5>
        <p>Boyut:</p>
        <p>Boyut</p>
        <p>Hamur:</p>
        <p>hamur</p>
        <p>Ek Malzemeler:</p>
        <p>ekmalzemeler</p>
        <SummaryDiv>
          <h6>Sipariş Toplamı</h6>
          <Summary1>
            <p>Seçimler</p>
            <p>55 tl</p>
          </Summary1>
          <Summary2>
            <p>Toplam</p>
            <p>100 tl</p>
          </Summary2>
        </SummaryDiv>
      </ContainerDiv>
    </PageDiv>
  );
};
export default OrderConfirmed;
